script: |
  super -f text -I q3065.spq | sort > q3065.out

inputs:
  - name: q3065.spq
    data: |
      SELECT DISTINCT - CAST ( NULL AS INTEGER ) * - col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE + - ( - col2 ) NOT BETWEEN ( - 91 - - - ( col0 ) * 16 + + + col0 + + col2 - - 0 ) AND + ( col2 ) AND 21 <= + col0;
  - name: tab0

outputs:
  - name: q3065.out
    data: |
